import { CoursePart } from "../types";

const Part = ({ course }: {course: CoursePart}) => {
    const typeCourse = course.type;
    switch (typeCourse) {
        case 'normal':
            return <div>
                <p>
                <i>{course.description}</i></p>
                </div>
            break;
        case 'groupProject':
            return <div>
                <p>
                project excersices {course.groupProjectCount}</p>
                
            </div>
            break;
        case 'submission':
            return <div>
                <p>
                <i>{course.description}</i><br />
                submit to <i>{course.exerciseSubmissionLink}</i>
                </p>

            </div>
            break;
        default:
            break;
    }
    return <h1>Nan</h1>
}

export default Part;
